import React from 'react'
import { Row, Col } from 'react-bootstrap';

export default function StaggeredText() {
    return (
        <div>
            <Row>
                <Col md = {4}>
                    <h3>LEFT SIDE</h3>
                </Col>
                <Col md = {{span: 4, offset: 4}}>
                    <h3>RIGHT SIDE</h3>
                </Col>
            </Row>
        </div>
    )
}
